import React from 'react';

import './About.css';

const About = () => {
  return (
    <div className="about__section">
      <div className="container">
        <h2 className="about__section_title">
          O NAS
        </h2>
        <p className="about__section_description">
          Rynek OZE cały czas się rozwija i zmienia. Technologia ewoluuje, rosną również standardy jakości obsługi. Szacuje się że najbliższe lata będą przełomowe o rozwój fotowoltaiki w Polsce. Głownie do tego ma przyczynić się program dofinansowań dla mikroinstalacji fotowoltaicznych Mój Prąd oraz rosnąca świadomość polaków odnośnie ochrony środowiska i zysków jakie płyną z posiadania własnej instalacji zasilanych panelami solarnymi. Może i TY chcesz skorzystać z tej zielonej transformacji i tworzyć z nami przyszłość
        </p>
      </div>
    </div>
  );
};
export default About;
